import React from 'react';
import { Footer } from '../component';
import * as Icon from 'react-feather';


export function FooterContainer() {
    return (<>
    <Footer.Line></Footer.Line>
    <Footer>
        <Footer.Link href="#"><Icon.Facebook color="#696969" size={20}/><Footer.Tooltip>Facebook</Footer.Tooltip></Footer.Link>
        <Footer.Link href="#"><Icon.Instagram color="#696969" size={20}/><Footer.Tooltip>Instagram</Footer.Tooltip></Footer.Link>
        <Footer.Link href="#"><Icon.Twitter color="#696969" size={20}/><Footer.Tooltip>Twitter</Footer.Tooltip></Footer.Link>
        <Footer.Link href="#"><Icon.GitHub color="#696969" size={20}/><Footer.Tooltip>Github</Footer.Tooltip></Footer.Link>
    </Footer></>)
}
